(8, 'Tupperware New Shelf Saver 850ml', 'Tempat Bumbu dari Tupperware', '85800', '57', 'dapur', 'dapur-8.jpg', 'Keistimewaan produk ini adalah memiliki seal yang rapat menahan udara masuk dan keluar dari wadah sehingga makanan yang ada di dalamnya dapat lebih tahan lama kesegarannya. Base bagian luarnya bertekstur kasar sehingga tidak mudah tergores sedangkan di bagian depan base terdapat garis tebal bertekstur licin berfungsi sebagai jendela untuk memudahkan melihat isinya. Stackable-beberapa produk yang sama dapat disusun menumpuk ke atas sehingga terlihat rapi dan menghemat ruang penyimpanan. Terdiri dari : Shelf Saver (2pcs) volume 850ml / 14.6 x 9.5 x 11.6 cm dan Spoon (2pcs); panjang : 10 cm.Dijamin! Harga termurah se-Indonesia!', 'Tupperware', 'Merah', 'Plastik PP', '16.6cm x 11.5cm x 13.6cm', '14.6cm x 9.5cm x 11.6cm', '1kg'),
(9, 'Tupperware Rice Smart', 'Tempat Beras dari Tupperware', '448500', '4', 'dapur', 'dapur-9.jpg', 'Dengan sistem Fresh In Fresh Out memastikan beras selalu terjaga kesegarannya. Bahannya yang transparan bisa memudahkan untuk melihat stok beras. Rice Smart juga memiliki slider. 1 slider setara dengan 150 gram. Jadi saat menarik slider beras yang tertuang ke laci sebanyak 150 gram."Dijamin! Harga termurah se-Indonesia!', 'Tupperware', 'Putih', 'Plastik PP', '39.8cm x 20.8cm x 41.2cm', '37.8cm x 18.8cm x 39.2cm', '1kg'),
(10, 'Tupperware Frosty Blue Collection', 'Toples & Kaleng dari Tupperware', '326300', '2', 'dapur', 'dapur-10.jpg', 'Satu paket terdiri dari : \r\na. Mini Freezermate with Dial (4) @290ml/ 11.1 x 7.3 x 7.7 cm \r\nb. Pocket Freezermate with Dial (2) @820ml/ 14.2 x 9.2 x 12.3 cm \r\nc. Medium Freezermate with Dial (1) 2.1L/ 21.5 x 16 x 11.5 cm \r\nd. Bonus booklet Dijamin! Harga termurah se-Indonesia!', 'Tupperware', 'Biru', 'Plastik PP', '23.15cm x 18cm x 13.5cm', '21.15cm x 16cm x 11.5cm', '1kg'),
(11, 'Lotte Mart L LIVING MINI FOOD CHOPPER TF1039A', 'Pisau & Alat Pemotong dari Lotte Mart', '129000', '84', 'dapur', 'dapur-11.jpg', '-', 'Lotte Mart', 'Hijau', 'Plastik; Stainless', '8cm x 8cm x 23cm', '22cm', '2kg'),
(12, 'As Seen On TV Better Beater 2pcs', 'Pengocok dari As Seen On TV', '90000', '12', 'dapur', 'dapur-12.jpg', 'Suka memasak dan membuat kue?Tapi tidak mau pakai mixer yang besar dan berat karena ribet?Tenang! Kini ada inovasi baru yang akan membuat memasak Anda jauh lebih mudah yaitu BETTER BEATER; Hand Mixer yang praktis dari As Seen on TV Indonesia. Alat ini tidak memerlukan baterai atau listrik karena cara kerjanya sangat mudah yaitu cukup ditekan kebawah maka mixer ini akan bekerja secepat mixer listrik.', 'As Seen On TV', 'Putih', 'Stainless', '6cm x 6cm x 30.5cm', 'Sama dengan ukuran kemasan', '1kg'),
(13, 'As Seen On TV Slap and Chop', 'Pisau & alat pemotong dari As Seen On TV', '160000', '25', 'dapur', 'dapur-13.jpg', 'Slap and Chopmerupakan alat bantu memasak yang revolusioner. Fungsinya serupa dengan blender. Namun pengerjaannya tidak memerlukan listrik; baterai; atau tenaga penggerak lainnya tetapi dilakukan manual dengan tangan. Jangan khawatir jari Anda akan teriris pisau sebab hand blender Slap Chop ini dirancang khusus untuk memotong dan mencincang sayuran; buah; bumbu; daging dan bahkan es batu dengan aman dan mudah. Di samping aman alat ini juga sangat praktis digunakan.Cara Membersihkan: Anda cukup membentangkan kedua sisi pengaman sampingnya sehingga menyerupai bunga. Cuci di bawah air mengalir. Setelah itu keringkan dan simpan di lemari dapur Anda.', 'As Seen On TV', 'Putih', 'Stainless; Plastik', '8.5cm x 8.5cm x 25cm', 'Sama dengan ukuran kemasan', '1kg'),
(14, 'Lotte Mart L LIVING SUPER MINCER TF858', 'Penggiling & Penumbuk Makanan dari Lotte Mart', '149000', '30', 'dapur', 'dapur-14.jpg', '-', 'Lotte Mart', 'Hijau', 'Plastik; Stainless', '11cm x 11cm x 12cm', '19cm', '2kg'),
