(16, 'Multi Roaster Wajan Pemanggang 31cm', 'Alat Panggang dari Multi Roaster', '120000', '37', 'dapur', 'dapur-16.jpg', 'Alat pemanggang yang terbuat dari bahan alumunium dengan dilengkapi alat pemutar api yang dapat merubah nyala api kompor menjadi bara sebagai pengganti arang. Tidak perlu arang; tidak perlu kipas- kipas. Cukup letakkan di atas kompor dan tunggu beberapa menit sampai pemutar api memerah. Letakkan daging atau apa saja yang ingin dipanggang; tinggal tunggu beberapa menit sambil di bolak balik', 'Multi Roaster', 'Metalik', 'Aluminium', '33cm x 33cm x 7cm', '6cm', '1kg'),
(17, 'Weston Round Chafing Dish W1X-CR30', 'Panci dari Weston', '74900', '37', 'dapur', 'dapur-17.jpg', 'Body terbuat dari bahan stainless steel anti karat. Desain klasik dan unik. Dilengkapi tutup kaca tahan panas. Kaki panci bisa dibongkar pasang', 'Weston', 'Metalik', 'Stainless Steel', '33cm x 33cm x 21cm', '30cm x 30cm x 18cm', '4kg'),
