(20, 'Lotte Mart CT-7 KS087-M 6PCS KNIFE SET', 'Pisau & Alat Pemotong dari Lotte Mart', '369000', '57', 'dapur', 'dapur-20.jpg', 'Satu paket terdiri dari 6pcs yang terdiri dari Chef Knife; Bread Knife; Slicer Knife; Utility Knife; Paring Knife dan 1 tempat pisau.', 'Lotte Mart', 'Hitam', 'Stainless; Plastik; Teflon', '22cm x 22cm x 4cm', 'Sama dengan ukuran kemasan', '2kg'),
(21, 'Nanaunique Store Kosayu Cutting Board Medium', 'Talenan dari Nanaunique Store', '80000', '9', 'dapur', 'dapur-21.jpg', 'Talenan mutifungsi berbentuk persegi panjang dengan pegangan pada bagian ujungnya. Talenan ini dibuat dari kayu jati dengan design yang sederhana namun sangat kuat dan kokoh. Talenan ini dibuat dengan 2 ukuran yaitu size Large dan Medium. Produk ini dikerjakan oleh tangan pengrajin (handmade) yang terbuat dari potongan kayu asli sehingga bentuk; motif; dan warna barang bisa berbeda-beda.', 'Nanaunique Store', 'Cokelat', 'Kayu Jati', '27cm x 15cm x 2cm', '27cm x 15cm x 2cm', '0.57kg'),
(22, 'Fancy Furni Right Slant Donut', 'Talenan dari Fancy Furni', '60000', '1', 'dapur', 'dapur-22.jpg', 'Produk ini dikerjakan oleh tangan pengrajin (Handmade). Barang yang dikirim 90% sesuai dengan foto', 'Fancy Furni', 'Cokelat', 'Kayu Jati', '28cm x 25cm x 3.5cm', '26cm x 23cm', '2kg'),
